// src/pages/WhiteboardSelectionPage.js
import React from "react";
import { useNavigate } from "react-router-dom";
import {
  Container,
  Card,
  CardContent,
  Typography,
  CardMedia,
} from "@mui/material";
import Grid2 from "@mui/material/Grid2"; // Updated import for Grid2

// Mock data for demonstration
const whiteboards = [
  {
    id: "wb_456",
    imageUrl: "https://via.placeholder.com/150",
    annotated: true,
  },
  {
    id: "wb_457",
    imageUrl: "https://via.placeholder.com/150",
    annotated: false,
  },
  {
    id: "wb_458",
    imageUrl: "https://via.placeholder.com/150",
    annotated: true,
  },
  {
    id: "wb_459",
    imageUrl: "https://via.placeholder.com/150",
    annotated: false,
  },
  {
    id: "wb_460",
    imageUrl: "https://via.placeholder.com/150",
    annotated: true,
  },
  {
    id: "wb_461",
    imageUrl: "https://via.placeholder.com/150",
    annotated: false,
  },
  {
    id: "wb_462",
    imageUrl: "https://via.placeholder.com/150",
    annotated: true,
  },
  {
    id: "wb_463",
    imageUrl: "https://via.placeholder.com/150",
    annotated: false,
  },
  {
    id: "wb_464",
    imageUrl: "https://via.placeholder.com/150",
    annotated: true,
  },
  {
    id: "wb_465",
    imageUrl: "https://via.placeholder.com/150",
    annotated: false,
  },
];

function WhiteboardSelectionPage() {
  const navigate = useNavigate();

  const handleCardClick = (id) => {
    navigate(`/label/${id}`);
  };

  return (
    <Container maxWidth="md" style={{ marginTop: "20px" }}>
      <Typography variant="h4" gutterBottom>
        Select a Whiteboard
      </Typography>
      <Grid2 container spacing={4}>
        {whiteboards.map((whiteboard) => (
          <Grid2 xs={12} sm={6} md={4} key={whiteboard.id}>
            <Card
              onClick={() => handleCardClick(whiteboard.id)}
              style={{ cursor: "pointer" }}
            >
              <CardMedia
                component="img"
                height="140"
                image={whiteboard.imageUrl}
                alt={`Whiteboard ${whiteboard.id}`}
              />
              <CardContent>
                <Typography variant="h6">{`Whiteboard ID: ${whiteboard.id}`}</Typography>
                <Typography
                  color={whiteboard.annotated ? "primary" : "textSecondary"}
                >
                  {whiteboard.annotated ? "Annotated" : "Not Annotated"}
                </Typography>
              </CardContent>
            </Card>
          </Grid2>
        ))}
      </Grid2>
    </Container>
  );
}

export default WhiteboardSelectionPage;
